import * as React from 'react';
import { Avatar, Button, Card, Title, Paragraph } from 'react-native-paper';
import { View } from 'react-native';

const Cardd = (props) => (
  <View key={props.id}>
  <Card key={props.id} style={{backgroundColor:"#00695c", marginBottom:"10%"}}>
    <Card.Content >
      <Title style={{color:"white"}}>{props.name}</Title>
      <Paragraph style={{color:"white"}}>{props.species}</Paragraph>
    </Card.Content>
    <Card.Cover source={{ uri: props.image }}  />
    <Card.Actions>
      <Button style={{color:"white"}}>Ver</Button>
    </Card.Actions>
  </Card>

  </View>
);

export default Cardd;
